# app.R — HANIFA PRS (Excel-only, multi-trait by sheets)
suppressPackageStartupMessages({
  library(shiny)
  library(readxl); library(dplyr); library(stringr)
  library(DT); library(writexl)
  library(bslib)
})

# ---------------- Brand palette ----------------
hanifa_primary <- "#233A8B"; hanifa_accent <- "#F4A020"
hanifa_dark <- "#101a46";    hanifa_light  <- "#f7fafc"

theme <- bs_theme(
  version = 5, primary = hanifa_primary, secondary = hanifa_accent,
  "font-size-base" = "1.03rem", "border-radius" = ".75rem", "btn-border-radius" = ".75rem"
)

# ---------- Helpers ----------
std_names <- function(x) tolower(gsub("\\s+", "", x))
need_cols <- c("snp","chr","bp","genotype","weight","riskallele")
is_missing_like <- function(x) x %in% c("--","II","DD") | is.na(x)
trim_ws <- function(x) gsub("^\\s+|\\s+$","",x)
sanitize_ws_name <- function(s) {
  s <- gsub("[\\/:*?\\[\\]]", "_", s)
  enc2native(substr(s, 1L, 31L))
}
dosage_vec <- function(geno, risk){
  geno <- toupper(geno); risk <- toupper(risk)
  out <- rep(NA_real_, length(geno))
  valid_risk <- risk %in% c("A","C","G","T")
  valid_geno <- nchar(geno)==2 & grepl("^[ACGT]{2}$", geno)
  ok <- valid_risk & valid_geno & !is_missing_like(geno)
  if(!any(ok)) return(out)
  a1 <- substr(geno[ok],1,1); a2 <- substr(geno[ok],2,2)
  out[ok] <- (a1==risk[ok]) + (a2==risk[ok])
  as.numeric(out)
}

# ---------- UI ----------
ui <- navbarPage(
  id = "mainnav", theme = theme,
  title = div(
    style = "display:flex;align-items:center;gap:.6rem;",
    img(src="logo.png", height="34", alt="HANIFA"),
    tags$span(style=sprintf("font-weight:700;color:%s", hanifa_primary),"HANIFA | Interactive PRS")
  ),
  header = tags$head(
    tags$style(HTML(sprintf("
      .navbar { box-shadow:0 4px 18px rgba(0,0,0,.07); }
      .nav-link, .navbar-brand { font-weight:600; }
      .welcome-card { border-radius:18px; box-shadow:0 10px 26px rgba(0,0,0,.08); padding:24px; background:#fff; }
      .soft { background:%s; border-radius:16px; padding:18px; }
      .note { color:#5b6275; font-size:1.05rem; }
      h3 { font-size:1.8rem; font-weight:800; color:%s; }
      h4 { font-size:1.25rem; font-weight:700; }
      .kpi { font-size:1.0rem; background:#eef2f7; border-radius:14px; padding:8px 12px; display:inline-block; margin:4px 8px 4px 0; }
      .cta-btn { width:100%%; padding:14px 18px; border-radius:14px; font-weight:700; }
      .btn-primary { background:%s; border-color:%s; }
      .btn-primary:hover, .btn-primary:focus { filter:brightness(0.95); }
    ", hanifa_light, hanifa_dark, hanifa_primary, hanifa_primary)))
  ),
  
  # ===== Excel (multi-trait) =====
  tabPanel(
    "From Excel (All-in-One)",
    fluidPage(
      br(),
      sidebarLayout(
        sidebarPanel(
          width=4,
          fileInput("xlsx","Upload Excel (.xlsx / .xls) — columns per sheet: SNP, CHR, BP, Genotype, Weight, RiskAllele",
                    accept=c(".xlsx",".xls")),
          uiOutput("sheet_picker_multi"),
          actionButton("compute_all","Compute PRS for selected sheets", class="btn-primary"),
          tags$hr(),
          downloadButton("download_all","Download XLSX (all traits)")
        ),
        mainPanel(
          width=8,
          h4("PRS Summary (per trait)"),
          DTOutput("summary_dt"),
          tags$hr(),
          h4("Per-SNP tables (by trait)"),
          uiOutput("pertrait_tabs"),
          tags$hr(),
          helpText("Genotypes treated as missing: --, II, DD. Dosage = copies of risk allele (0/1/2). PRS = Σ (Dosage × Weight).")
        )
      )
    )
  )
)

# ---------- Server ----------
server <- function(input, output, session){
  
  # list sheets
  sheets <- reactive({
    req(input$xlsx)
    readxl::excel_sheets(path = input$xlsx$datapath)
  })
  
  # multi-select sheets (traits)
  output$sheet_picker_multi <- renderUI({
    req(sheets())
    tagList(
      checkboxGroupInput("sel_sheets","Select sheets (traits):",
                         choices = sheets(), selected = sheets()),
      helpText("Tip: Each selected sheet will be treated as one trait; names come from the sheet titles.")
    )
  })
  
  # read & normalize one sheet
  read_trait_sheet <- function(path, sheet_name){
    df <- readxl::read_excel(path, sheet = sheet_name, guess_max = 10000)
    nm <- std_names(names(df)); names(df) <- nm
    missing <- setdiff(need_cols, nm)
    if(length(missing)>0){
      stop(sprintf("Sheet '%s' is missing required columns: %s",
                   sheet_name, paste(missing, collapse=", ")))
    }
    out <- df %>% transmute(
      SNP       = as.character(.data[["snp"]]),
      CHR       = as.character(.data[["chr"]]),
      BP        = suppressWarnings(as.double(.data[["bp"]])),
      Genotype  = toupper(as.character(.data[["genotype"]])),
      Weight    = suppressWarnings(as.double(.data[["weight"]])),
      RiskAllele= toupper(as.character(.data[["riskallele"]]))
    )
    # validations
    if(!all(out$RiskAllele %in% c("A","C","G","T")))
      stop(sprintf("Sheet '%s': RiskAllele must be A/C/G/T.", sheet_name))
    if(!all(nchar(out$Genotype)==2 | is_missing_like(out$Genotype)))
      stop(sprintf("Sheet '%s': Genotype must be like AA/AG/... or --/II/DD.", sheet_name))
    
    out <- out %>% mutate(
      SNP        = trim_ws(SNP),
      Genotype   = toupper(trim_ws(Genotype)),
      RiskAllele = toupper(trim_ws(RiskAllele)),
      Dosage     = dosage_vec(Genotype, RiskAllele),
      Score      = Dosage * Weight
    )
    list(table = out, prs = sum(out$Score, na.rm=TRUE))
  }
  
  # compute all selected sheets
  results_all <- eventReactive(input$compute_all, {
    req(input$xlsx, input$sel_sheets)
    path <- input$xlsx$datapath
    sel  <- input$sel_sheets
    validate(need(length(sel) > 0, "Please select at least one sheet."))
    # iterate and collect
    out_list <- list(); errs <- character()
    for(sh in sel){
      res <- try(read_trait_sheet(path, sh), silent = TRUE)
      if(inherits(res, "try-error")){
        errs <- c(errs, as.character(attr(res, "condition")$message))
      } else {
        out_list[[sh]] <- res
      }
    }
    validate(need(length(out_list) > 0, paste0("No valid sheets. Errors:\n", paste(errs, collapse="\n"))))
    attr(out_list, "errors") <- errs
    out_list
  }, ignoreInit = TRUE)
  
  # summary table
  output$summary_dt <- renderDT({
    req(results_all())
    lst <- results_all()
    tibble::tibble(
      Trait = names(lst),
      PRS   = vapply(lst, function(x) x$prs, numeric(1))
    ) %>%
      datatable(rownames=FALSE, options=list(pageLength=10, dom="tp"))
  })
  
  # per-trait tabset
  output$pertrait_tabs <- renderUI({
    req(results_all())
    tabs <- lapply(names(results_all()), function(tr){
      DT::renderDT(results_all()[[tr]]$table,
                   options = list(pageLength=10, scrollX=TRUE, dom="tp"),
                   rownames = FALSE)
      tabPanel(tr, DTOutput(paste0("dt_", tr)))
    })
    # bind DT outputs
    lapply(names(results_all()), function(tr){
      local({
        tr_local <- tr
        output[[paste0("dt_", tr_local)]] <- DT::renderDT(
          results_all()[[tr_local]]$table,
          options = list(pageLength=15, scrollX=TRUE, dom="tp"),
          rownames = FALSE
        )
      })
    })
    do.call(tabsetPanel, tabs)
  })
  
  # download writer
  output$download_all <- downloadHandler(
    filename = function(){
      paste0("PRS_results_multi_", format(Sys.time(), "%Y%m%d_%H%M%S"), ".xlsx")
    },
    content = function(file){
      req(results_all())
      lst <- results_all()
      # Summary sheet
      summary_df <- tibble::tibble(
        Trait = names(lst),
        PRS   = vapply(lst, function(x) x$prs, numeric(1))
      )
      # Compose workbook sheets
      wb <- list()
      wb[["PRS_Summary"]] <- summary_df
      for(nm in names(lst)){
        safe <- sanitize_ws_name(nm)
        wb[[safe]] <- lst[[nm]]$table
      }
      writexl::write_xlsx(wb, path = file)
    }
  )
}

shinyApp(ui, server)

