# Shiny menu-style app with HANIFA logo in navbar
# Place logo file at: ./www/hanifa_logo.png

library(shiny)
library(shinythemes)

ui <- navbarPage(
  title = div(
    style = "display:flex; align-items:center; gap:10px;",
    img(src = "logo.png", height = "36"), # logo from ./www/
    span("HANIFA")
  ),
  theme = shinytheme("flatly"),
  id = "mainnav",
  
  tabPanel("Home",
           fluidPage(
             br(),
             fluidRow(
               column(
                 12,
                 div(style = "display:flex; align-items:center; gap:16px;",
                     img(src = "logo.png", height = "64"),
                     tags$div(
                       h3("Welcome to HANIFA demo app"),
                       tags$p("This app demonstrates interactive inputs, BMI calculation, and image display in Shiny.")
                     )
                 ),
                 hr()
               )
             )
           )
  ),
  
  tabPanel("Personal Info",
           sidebarLayout(
             sidebarPanel(
               textInput("name", "Enter your name:", ""),
               numericInput("age", "Enter your age:", value = NA, min = 0, max = 120, step = 1),
               textInput("city", "Enter your city:", ""),
               actionButton("saveInfo", "Save / Show")
             ),
             mainPanel(
               h4("Result"),
               verbatimTextOutput("infoOut"),
               uiOutput("adultFlag")
             )
           )
  ),
  
  tabPanel("BMI Calculator",
           sidebarLayout(
             sidebarPanel(
               numericInput("weight", "Weight (kg):", value = NA, min = 1, step = 0.1),
               numericInput("height", "Height (m):", value = NA, min = 0.3, step = 0.01),
               actionButton("calcBMI", "Calculate BMI")
             ),
             mainPanel(
               h4("BMI Result"),
               verbatimTextOutput("bmiOut"),
               uiOutput("bmiCat")
             )
           )
  ),
  
  tabPanel("About",
           fluidPage(
             h4("How to use"),
             tags$ul(
               tags$li("Personal Info: fill the fields and click 'Save / Show'."),
               tags$li("BMI: enter weight and height, then click 'Calculate BMI'."),
               tags$li("Images: static logo is served from ./www/.")
             ),
             hr(),
             tags$small("Demo app for interactive inputs and images in Shiny.")
           )
  )
)

server <- function(input, output, session) {
  # --- Personal Info ---
  observeEvent(input$saveInfo, {
    validate(
      need(nzchar(input$name), "Please enter your name."),
      need(!is.na(input$age), "Please enter a valid age."),
      need(nzchar(input$city), "Please enter your city.")
    )
    txt <- sprintf("Hello %s!\nYou are %d years old and live in %s.",
                   input$name, as.integer(input$age), input$city)
    output$infoOut <- renderText(txt)
    
    output$adultFlag <- renderUI({
      if (!is.na(input$age)) {
        if (as.numeric(input$age) >= 18) {
          tags$p("You are an adult.", style = "color:#2c7a7b; font-weight:600;")
        } else {
          tags$p("You are underage.", style = "color:#c53030; font-weight:600;")
        }
      }
    })
  })
  
  # --- BMI Calculator ---
  observeEvent(input$calcBMI, {
    validate(
      need(!is.na(input$weight) && input$weight > 0, "Please enter a valid weight in kg."),
      need(!is.na(input$height) && input$height > 0, "Please enter a valid height in meters.")
    )
    bmi <- input$weight / (input$height ^ 2)
    output$bmiOut <- renderText(sprintf("Your BMI is: %.2f", bmi))
    
    output$bmiCat <- renderUI({
      catg <- cut(bmi,
                  breaks = c(-Inf, 18.5, 25, 30, Inf),
                  labels = c("Underweight", "Normal weight", "Overweight", "Obesity"))
      tags$p(paste("Category:", catg), style = "font-weight:600;")
    })
  })
}

shinyApp(ui, server)

installed_pkgs = data.frame(installed.packages(applibpath), stringsAsFactors = FALSE)

# Ensure that a package is installed
ensure <- function(pkgs, lib_loc = applibpath) {

  pkg_names <- gsub("_.*", "", basename(pkgs))

  for (i in seq_along(pkgs)) {
    setWinProgressBar(pb,
      value = grep(paste0("\\b", pkg_names[i], "\\b"), pkg_names) / (length(pkg_names) + 1),
      label = sprintf("Loading - %s...", pkg_names[i]))

    if (!pkg_names[i] %in% installed_pkgs$Package) {
      install.packages(pkgs = pkgs[i], lib = lib_loc, repos = NULL, type = "win.binary")
      message(paste0(pkg_names[i], " installed\n"))
    }
  }
}

get_remote_version <- function(
  app_repo = "none", host = "none",
  auth_user = "none", auth_pw  = "none",
  auth_token = "none", ping_site = "") {

  # Fail early
  if (app_repo == "none") return("none")
  if (class(try(httr::http_error(ping_site))) == "try-error") return("none")

  # Method to provide more specific feedback
  warn_user <- function(response) {
    sc <- httr::status_code(response)

    if (sc == 200) {
      return(response)

    } else if (sc == 403) {
      stop("This is a private repo. Provide an authorized user and password to create_config().")

      } else {
      stop("It looks like your username and/or password are incorrect.")
    }
  }

  # Private Repos
  if (auth_pw != "none" | auth_token != "none") {
    if (host == "bitbucket") {
      base_url <-
        sprintf("https://api.bitbucket.org/2.0/repositories/%s/versions",
          app_repo)
      response <- warn_user(
        httr::GET(base_url, httr::authenticate(auth_user, auth_pw)))
      parsed_response <- httr::content(response, "parsed", encoding = "utf-8")
      app_version <- parsed_response$values[[1]]$name
      return(app_version)

    } else if (host == "github") {
      base_url <-
        sprintf("https://api.github.com/repos/%s/releases", app_repo)
      response <- warn_user(
        httr::GET(base_url, httr::authenticate(auth_token, "x-oauth-basic", "basic")))
      parsed_response <- httr::content(response, "parsed", encoding = "utf-8")
      app_version <- parsed_response[[1]]$tag_name
      return(app_version)
    }
  # Public Repos
  } else {
    if (host == "bitbucket") {
      base_url <-
        sprintf("https://api.bitbucket.org/2.0/repositories/%s/versions",
                app_repo)
